        var __coltypeMob= {"12/12":"col-xs-12","11/12":"col-xs-11","10/12":"col-xs-10","9/12":"col-xs-9","8/12":"col-xs-8","7/12":"col-xs-7","6/12":"col-xs-6","5/12":"col-xs-5","4/12":"col-xs-4","3/12":"col-xs-3","2/12":"col-xs-2","1/12":"col-xs-1"};
